import React, {FC} from 'react';
import {ITaskListItemProps} from "./ITaskListItemProps";
import ChildrenTaskListItem from "./ChildrenTaskListItem";

const TaskListItem: FC<ITaskListItemProps> = ({task, children}) => {
    return (
        <div>
            {task.name}
            <>
                {
                    children?.map(childrenTask =>
                        <ChildrenTaskListItem task={childrenTask}/>
                    )
                }
            </>
        </div>
    );
};

export default TaskListItem;
